import './Item.css'
import {Button} from '@material-ui/core'
const Item = (title,desc,textbtn1,textbtn2,descbottom) => {
    return ( 
            <div className="container">
                <div className="title">
                    {title}
                </div>
                <div className="description">
                    {desc}
                </div>
                <Button />
            </div>
     )
}
 
export default Item;
